static void generate_rgb565_data(unsigned short* pbuffer, unsigned int x, unsigned int y, unsigned int w, unsigned int h, int rotation, unsigned short* prgb565)
{
	int i, j;
	unsigned int xoff = (w - 64) / 2;
	unsigned int yoff = (h - 64) / 2;
	unsigned short* pdata = pbuffer;

	SCI_ASSERT(w >= 64);
	SCI_ASSERT(h >= 64);


	pdata += (x+w) * y;
	pdata += x;
	for (i=0; i<h; i++)
	{
		memset(pdata, 0xff, w*2);
		pdata += x + w;
	}
	

	// mark figure
	pbuffer += (x+w) * (y + yoff);
	pbuffer += x + xoff;
	if (rotation == 1)
	{
		for (i=0; i<64; i++)
		{
			for (j=0; j<64; j++)
			{
				pbuffer[j] = prgb565[(63-j) * 64 + i];
			}
			pbuffer += x+w;
		}
	}
	else if (rotation == 2)
	{
		pbuffer += 64 * (x+w);
		for (i=0; i<64; i++)
		{
			memcpy(pbuffer, prgb565, 64*2);
			pbuffer -= (x+w);
			prgb565 += 64;
		}
	}
	else if (rotation == 3)
	{
		for (i=0; i<64; i++)
		{
			for (j=0; j<64; j++)
			{
				pbuffer[j] = prgb565[j * 64 + (63-i)];
			}
			pbuffer += x+w;
		}
	}
	else
	{
		for (i=0; i<64; i++)
		{
			memcpy(pbuffer, prgb565, 64*2);
			pbuffer += (x+w);
			prgb565 += 64;
		}
	}
}

