static void CameraTimerCallBack()
{
	DCAMERA_PREVIEW_PARAM_T* param_ptr = &dc_service_ctx.preview_param;
    BLOCKCFG_T cfg = {0};
    BLOCKCFG_T reset_cfg = {0};
    
    LCD_GetConfigBlock(0, 0, &cfg);
    
    LCD_GetConfigBlock(0, 0, &reset_cfg);

    reset_cfg.resolution = 2;
    LCD_ConfigBlock(0,0, reset_cfg);
    
	generate_rgb565_data(dc_service_ctx.prgb565, param_ptr->disp_rect.x, param_ptr->disp_rect.y, param_ptr->disp_rect.w, param_ptr->disp_rect.h, param_ptr->rotation_mode, camera_rgb565_data[dc_service_ctx.count%10]);
	LCD_SetBlockBuffer(param_ptr->lcd_id, param_ptr->lcd_block_id, dc_service_ctx.prgb565);
	LCD_InvalidateRect(param_ptr->lcd_id, param_ptr->disp_rect.x, param_ptr->disp_rect.y, param_ptr->disp_rect.w, param_ptr->disp_rect.h);

    LCD_ConfigBlock(0,0, cfg);

	dc_service_ctx.count ++;
}

